import React, {useCallback, useEffect, useState} from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Layout from "../components/Layout";
import clsx from "clsx";
import {useHttp} from "../hooks/http.hooks";
import TermCard from "../components/TermCard";
import MainTermCard from "../components/MainTermCard";

const useStyles = makeStyles((theme) => ({
    root: {
        backgroundColor: '#41B3A3',
        height: '90.6vh',
    },
    left: {},
    main: {},
    right: {}
}));

export default function TermsPage(props: any) {
    const classes = useStyles();
    const {loading, request} = useHttp()
    const [terms, setTerms] = useState()

    const fetchTerms = useCallback(async () => {
        try {
            const fetched = await request('/api/term', 'GET', null, {})
            setTerms(fetched)
        } catch (e) {
        }
    }, [request])

    useEffect(() => {
        fetchTerms()
    }, [fetchTerms])

    return (
        <div className={classes.root}>
            <Layout>
                <div className={clsx('max-w-full max-h-screen flex justify-center items-center', classes.root)}>
                    <div className={classes.left}>
                        <TermCard
                            img="data:image/png;base64,"
                            altImg="Fusce viverra" header='Machine Learning'/>
                    </div>
                    <div className={classes.main}>
                        <MainTermCard
                            img="data:image/png;base64,"
                            altImg="" header='AI(Artificial Intellegence)'
                            desc='Artificial intelligence (AI) is intelligence demonstrated by machines, unlike the natural intelligence displayed by humans and animals, which involves consciousness and emotionality.'/>
                    </div>
                    <div className={classes.right}>
                        <TermCard
                            img="data:image/png;base64,"
                            altImg="" header='Human Mind'/>
                    </div>
                </div>
            </Layout>
        </div>
    );
}
